import React from 'react';

function About() {
  return (
    <section className='my-5'>
      <div className='my-2'>
        <div className='profile-img my-5'>
          <i className='fas fa-user-circle' style={{ fontSize: '96px' }}></i>
        </div>
        <p>
          Hey! I am Faissal. I am a Full-Stack Web Developer with a passion for building
          mobile-first applications that allow the user to have a performant experience all
          platforms and devices. My foundational skills are within the MERN stack, which I use to
          effectively build industry standard applications.
        </p>
        <p></p>
      </div>
    </section>
  );
}

export default About;
